import React, { useState } from 'react';
import emailjs from '@emailjs/browser';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);

    try {
      await emailjs.send(
        'service_rad30ti',
        'template_6sww8lv',
        formData,
        'u92ZvICoQgvFk7T10'
      );
      alert('Message sent successfully!');
      setFormData({ name: '', email: '', subject: '', message: '' });
    } catch (error) {
      alert('Failed to send message. Please try again later.');
    } finally {
      setIsSubmitting(false);
    }
  };

  const socialLinks = [
    { icon: 'fab fa-github', url: 'https://github.com/visheshpanchal27', label: 'GitHub' },
    { icon: 'fab fa-linkedin', url: 'https://www.linkedin.com/in/vishesh-panchal-144281353', label: 'LinkedIn' },
    { icon: 'fab fa-twitter', url: 'https://twitter.com/visheshpanchal', label: 'Twitter' }
  ];

  return (
    <section id="contact" className="py-20 px-4 bg-gray-50 dark:bg-gray-800">
      <div className="container mx-auto">
        <h2 className="text-3xl md:text-4xl font-bold text-primary text-center mb-12">Get In Touch</h2>
        <div className="grid md:grid-cols-2 gap-8 max-w-4xl mx-auto">

          <div className="space-y-6">
            <h3 className="text-xl font-bold text-primary mb-4">Contact Info</h3>
            <div className="flex items-center gap-3">
              <i className="fas fa-envelope text-primary text-xl"></i>
              <a
                href="mailto:visheshpanchal864@gmail.com"
                className="hover:text-primary transition-colors duration-300"
              >
                visheshpanchal864@gmail.com
              </a>
            </div>
            <div className="flex gap-4 mt-6">
              {socialLinks.map((link, index) => (
                <a
                  key={index}
                  href={link.url}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-primary text-2xl hover:transform hover:-translate-y-1 hover:scale-110 transition-all duration-300"
                  aria-label={link.label}
                >
                  <i className={link.icon}></i>
                </a>
              ))}
            </div>
          </div>

          <form onSubmit={handleSubmit} className="bg-white dark:bg-gray-700 p-6 rounded-lg shadow-lg space-y-4">
            <h3 className="text-xl font-bold text-primary mb-4">Send Message</h3>
            <input
              type="text"
              name="name"
              placeholder="Your Name"
              value={formData.name}
              onChange={handleChange}
              required
              className="w-full p-3 bg-gray-100 dark:bg-gray-600 border-none rounded-lg focus:ring-2 focus:ring-primary outline-none"
            />
            <input
              type="email"
              name="email"
              placeholder="Your Email"
              value={formData.email}
              onChange={handleChange}
              required
              className="w-full p-3 bg-gray-100 dark:bg-gray-600 border-none rounded-lg focus:ring-2 focus:ring-primary outline-none"
            />
            <input
              type="text"
              name="subject"
              placeholder="Subject"
              value={formData.subject}
              onChange={handleChange}
              required
              className="w-full p-3 bg-gray-100 dark:bg-gray-600 border-none rounded-lg focus:ring-2 focus:ring-primary outline-none"
            />
            <textarea
              name="message"
              placeholder="Your Message"
              rows="5"
              value={formData.message}
              onChange={handleChange}
              required
              className="w-full p-3 bg-gray-100 dark:bg-gray-600 border-none rounded-lg focus:ring-2 focus:ring-primary outline-none resize-none"
            ></textarea>
            <button
              type="submit"
              disabled={isSubmitting}
              className="bg-primary hover:bg-accent text-white px-6 py-3 rounded-lg transition-all duration-300 hover:scale-105 flex items-center gap-2 disabled:opacity-50"
            >
              {isSubmitting ? 'Sending...' : 'Send'} <i className="fas fa-paper-plane"></i>
            </button>
          </form>
        </div>
      </div>
    </section>
  );
};

export default Contact;
